import React, { Component } from 'react';
import './app-header.css';

export default class AppHeader extends Component {

    render() {
        return (
            <div className="app-header">
                <nav className="menu">
                    <ul className="list-menu">
                        <li className="item-menu">Главная</li> 
                        <li className="item-menu">Фильтер</li> 
                        <li className="item-menu">Войти</li> 
                        <li className="item-menu">Регист</li> 
                    </ul>
                    
                </nav>

                <h1>Hello world</h1>
                
                <div>
                    <h4>Your Order</h4>
                </div>
            </div>   
        );
    };
};
